const { inspect } = require('node:util');
const embed = new DiscordJS.MessageEmbed().setFooter(msg.author.tag, msg.author.displayAvatarURL({ dynamic: true, format: 'png', size: 4096 }));

const code = (lang, text) => (`\`\`\`${lang}\n${String(text).slice(0, 1000) + (text.length >= 1000 ? '...' : '')}\n\`\`\``).replace(this.getDBM().Bot.bot.token, '*'.repeat(this.getDBM().Bot.bot.token.length));
const query = tempVars('text');

if (!query) msg.channel.send('Please, write something so I can evaluate!');
else {
  try {
    const evald = eval(query);
    const res = typeof evald === 'string' ? evald : inspect(evald, { depth: 0 });

    embed.addField('Result', code('js', res));

    if (!Boolean(res) || (!Boolean(evald) && evald !== 0)) embed.setColor('RED');
    else embed.setColor('GREEN');
  } catch (error) {
    embed
      .addField('Error', code('js', error))
      .setColor('RED')
  } finally {
    msg.channel.send({ embeds: [embed] }).catch(error => {
      msg.channel.send(`There was an error while displaying the eval result! ${error.message}`)
    })
  }
}
